import React, { useEffect, useState } from "react";
import { getRunners, getRunnerByEmail, createOrUpdateRunner } from "../services/api";

const Home = () => {
  const [runners, setRunners] = useState([]);
  const [error, setError] = useState("");
  const [email, setEmail] = useState("");
  const [newRunner, setNewRunner] = useState({ name: "", email: "" });
  const [selectedRunner, setSelectedRunner] = useState(null);

  // Carregar a lista de corredores
  useEffect(() => {
    getRunners()
      .then((response) => setRunners(response.data))
      .catch(() => setError("Erro ao carregar corredores."));
  }, []);

  // Buscar treinos pelo e-mail do usuário
  const handleSearch = () => {
    if (!email) return setError("Por favor, insira um e-mail.");

    getRunnerByEmail(email)
      .then((response) => {
        setSelectedRunner(response.data);
        setError("");
      })
      .catch(() => setError("Usuário não encontrado."));
  };

  // Cadastrar um novo usuário
  const handleRegister = (e) => {
    e.preventDefault();
    if (!newRunner.name || !newRunner.email) {
      return setError("Preencha todos os campos para cadastrar.");
    }

    createOrUpdateRunner(newRunner)
      .then(() => {
        setError("");
        setRunners([...runners, newRunner]); // Atualiza a lista localmente
        setNewRunner({ name: "", email: "" }); // Limpa o formulário
      })
      .catch(() => setError("Erro ao cadastrar o usuário."));
  };

  return (
    <div style={{ padding: "20px" }}>
      <h1>MARATONA DO RIO 2025</h1>

      {error && <p style={{ color: "red" }}>{error}</p>}

      {/* Formulário para Cadastrar Novo Usuário */}
      <div>
        <h2>Cadastrar Usuário</h2>
        <form onSubmit={handleRegister} style={{ marginBottom: "20px" }}>
          <div>
            <label>
              Nome:
              <input
                type="text"
                value={newRunner.name}
                onChange={(e) =>
                  setNewRunner({ ...newRunner, name: e.target.value })
                }
                style={{ marginLeft: "10px" }}
              />
            </label>
          </div>
          <div style={{ marginTop: "10px" }}>
            <label>
              Email:
              <input
                type="email"
                value={newRunner.email}
                onChange={(e) =>
                  setNewRunner({ ...newRunner, email: e.target.value })
                }
                style={{ marginLeft: "10px" }}
              />
            </label>
          </div>
          <button type="submit" style={{ marginTop: "10px" }}>
            Cadastrar
          </button>
        </form>
      </div>

      {/* Campo de Busca por E-mail */}
      <div>
        <h2>Buscar Treinos</h2>
        <input
          type="email"
          placeholder="Digite o e-mail do corredor"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          style={{ marginRight: "10px" }}
        />
        <button onClick={handleSearch}>Buscar</button>

        {/* Mostrar Treinos do Usuário Selecionado */}
        {selectedRunner && (
          <div style={{ marginTop: "20px" }}>
            <h3>Detalhes do Corredor</h3>
            <p>
              <strong>Nome:</strong> {selectedRunner.name || "Não informado"}
            </p>
            <p>
              <strong>Email:</strong> {selectedRunner.email}
            </p>
            <h4>Treinos:</h4>
            {selectedRunner.runningWorkouts.length > 0 ? (
              <ul>
                {selectedRunner.runningWorkouts.map((workout) => (
                  <li key={workout.id}>
                    <p>
                      <strong>Semana:</strong> {workout.week}
                    </p>
                    <p>
                      <strong>Treino Longo:</strong> {workout.longRunDistance} km em{" "}
                      {workout.longRunDurationMinutes} (ritmo: {workout.longRunPace})
                    </p>
                  </li>
                ))}
              </ul>
            ) : (
              <p>Nenhum treino registrado.</p>
            )}
          </div>
        )}
      </div>

      {/* Lista de Corredores */}
      <div style={{ marginTop: "40px" }}>
        <h2>Lista de Corredores</h2>
        <ul>
          {runners.map((runner) => (
            <li key={runner.email}>
              <p>
                <strong>Nome:</strong> {runner.name || "Não informado"}
              </p>
              <p>
                <strong>Email:</strong> {runner.email}
              </p>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default Home;
